        "description": "Occurred on December 23, 2022 / Niagara, Ontario, Canada\n\nThis is our dog Ollie - a mini Australian shepherd. He loves the snow and every winter he spends most of his time in our backyard. During a blizzard, snow was accumulating quickly and the wind was blowing it everywhere, hence all the snow on his fur. When it was finally time to come inside, we wasn’t ready (as you can tell with the attitude) and proceeded to walk away, shake off the snow, and continue to lay outside. In the end, he came inside and all was wellbut it’s a great video to showcase how some dog breeds thrive outside in the winter.\n\nContact licensing@viralhog.com to license this or any ViralHog video. ViralHog is based in Bozeman, Montana, USA.\n\nMake money from your videos! Submit footage here: https://viralhog.com/submit\n\nSubscribe, Like, or Follow ViralHog:\nYouTube: https://www.youtube.com/viralhog\nFacebook: https://fb.me/viralhog\nInstagram: https://instagr.am/viralhog\nTwitter: https://twitter.com/viralhog\nTikTok: https://www.tiktok.com/@viralhog",
