        "title": "Tierheim am Limit | Die Nordreportage | NDR Doku",
        "description": "Das Tierheim in der Hemmstraße in Bremen ist voll. Trotzdem bekommt Leiterin Sina Fehr jeden Tag vier bis sechs Anfragen von Menschen, die ihre Hunde abgeben wollen oder müssen. Während der Corona-Pandemie haben sich viele Menschen ein Haustier angeschafft. Jetzt landen viele dieser Tiere im Tierheim. Die Gründe: Urlaubsplanung, Zeitmangel, Überforderung. Vor allem Hunde sind betroffen. Aber auch das Katzenhaus und die Exotenstation sind voll. Viele dieser Tiere sind schlecht erzogen und verhaltensauffällig und damit schwer vermittelbar.\r\n\r\nUnd das Tierheim steht vor seiner nächsten großen Herausforderung. Es wird befürchtet, dass die aktuelle Wirtschaftslage dazu führen wird, dass viele Menschen sich ein Haustier schlicht nicht mehr leisten können. Futter und Tierarztkosten werden teurer. Auch das Tierheim leidet darunter. Die Ausgaben steigen, gleichzeitig gehen die Spendeneinnahmen zurück. Trotzdem versuchen Sina Fehr und ihr Team alles, um den Tieren in Not zu helfen und sie möglichst wieder zu vermitteln.\r\n\r\n\"Die Nordreportage\" begleitet ein engagiertes Tierheim-Team am Limit seiner Kapazitäten und Kräfte.\r\n\r\nMehr dazu: https://www.ndr.de/fernsehen/sendungen/die_nordreportage/Tierheim-am-Limit,sendung1312338.html\r\n\r\nWeitere Dokus findet ihr in der ARD Mediathek:\r\nhttps://www.ardmediathek.de/dokus\r\n\r\nErstausstrahlung: 4. Januar 2023\r\n\r\n#ndr #doku #tierheim",
